import React from "react";
import "./Profile.css";

function Profile() {
  return (
    <form className="profile__form">
      <h2 className="profile__title">Привет, Андрей!</h2>
      <input
        name="name"
        type="text"
        placeholder="Имя"
        className="profile__input"
        // value={value}
        minLength="2"
        maxLength="30"
        autoComplete="off"
        //   value={values.name || ''}
        //   onChange={handlesChange}
        required
      />
      <span id="error" className="sign__error"></span>
      <input
        name="email"
        type="email"
        placeholder="Email"
        className="profile__input"
        // value={value}
        minLength="2"
        maxLength="30"
        autoComplete="off"
        //   value={values.name || ''}
        //   onChange={handlesChange}
        required
      />
      <span id="error" className="sign__error"></span>
      <button className="profile__submit" type="submit">
        Редактировать
      </button>
    </form>
  );
}

export default Profile;
